import React from "react";
import { LoadScript, GoogleMap } from '@react-google-maps/api';

import { SkeletonText } from "@chakra-ui/react";

export default function GoogleMapsApi() {

    const center = { lat: 48.8584, lng: 2.2945 }

    const { isLoaded } = useJsApiLoader({
        googleMapsApiKey: "AIzaSyA_WC7fO9PYuaWNHV4Bg5nw_Q_O6VLzLfo"
    })

    if (!isLoaded) {
        <SkeletonText />
    }

    return (
        <LoadScript googleMapsApiKey="AIzaSyA_WC7fO9PYuaWNHV4Bg5nw_Q_O6VLzLfo">
        <GoogleMap
            center={center}
            zoom={15}
            mapContainerStyle={{ width: '250px', height: '250px' }}
            onLoad
        >

        </GoogleMap>

        </LoadScript>
    )
}
